    private static List<List<string>> ConvertToMatrix(List<string> inputStrings)
    {
        List<List<string>> matrix = new();
        foreach (string line in inputStrings)
        {
            List<string> row = new();
            foreach (char ch in line)
            {
                row.Add(ch.ToString());
            }
            matrix.Add(row);
        }
        return matrix;
    }

    private static int CountXMASPatterns(List<List<string>> matrix)
    {
        int rows = matrix.Count;
        int cols = matrix[0].Count;
        int count = 0;

        for (int i = 1; i < rows - 1; i++)  // Skip borders
        {
            for (int j = 1; j < cols - 1; j++)
            {
                if (IsXMASPattern(matrix, i, j))
                    count++;
            }
        }
        return count;
    }

    private static bool IsXMASPattern(List<List<string>> matrix, int row, int col)
    {
        // Check if either diagonal has "MAS" or "SAM" sequences centered at (row, col)
        return
            // Top-left to bottom-right
            ((matrix[row - 1][col - 1] == "M" && matrix[row][col] == "A" && matrix[row + 1][col + 1] == "S") ||
             (matrix[row - 1][col - 1] == "S" && matrix[row][col] == "A" && matrix[row + 1][col + 1] == "M")) &&

            // Top-right to bottom-left
            ((matrix[row - 1][col + 1] == "M" && matrix[row][col] == "A" && matrix[row + 1][col - 1] == "S") ||
             (matrix[row - 1][col + 1] == "S" && matrix[row][col] == "A" && matrix[row + 1][col - 1] == "M"));
    }
